INSERT INTO `profils` (`id`, `user_id`, `mobilenumber`, `age`, `location`, `created_at`, `updated_at`, `sex`, `destination`, `startdate`, `interests`, `looking_for`, `about`, `image`) VALUES
(1, 1, '01734943944', 40, 'Darmstadt', NULL, NULL, 'female', 'Florence', '2016-08-19', 'sight-seeing, meeting new people', 'Meet Up, TravelMate', 'I love discovering the world - cultures, languages, landscapes!!!', );
INSERT INTO `profils` (`id`, `user_id`, `mobilenumber`, `age`, `location`, `created_at`, `updated_at`, `sex`, `destination`, `startdate`, `interests`, `looking_for`, `about`, `image`) VALUES
(2, 2, '01754678907', 23, 'Melbourne', NULL, NULL, 'male', 'Berlin', '2016-09-15', 'Nature, Trekking, Culture', 'TravelMate, Roadtrip, Meet Up', 'Hey :) Currently planning a month (maybe 2 or 3) backpacking trip in Europe starting in mid-end of September. I want to visit Germany, Belgium, Netherlands, Hungary, Croatia, Italy and Greece.', );
INSERT INTO `profils` (`id`, `user_id`, `mobilenumber`, `age`, `location`, `created_at`, `updated_at`, `sex`, `destination`, `startdate`, `interests`, `looking_for`, `about`, `image`) VALUES
(3, 3, '017356565656', 23, 'Tokio', NULL, NULL, 'female', 'Peking', '2016-10-19', 'sight-seeing, relax, food', 'new friends', 'I love seeing different countries and learn something about their culture, food and language. Maybe there is someone beyond the other TravelMates who shares my interests and wants to travel along with me for some time.', );
INSERT INTO `profils` (`id`, `user_id`, `mobilenumber`, `age`, `location`, `created_at`, `updated_at`, `sex`, `destination`, `startdate`, `interests`, `looking_for`, `about`, `image`) VALUES
(4, 4, '0467893034', 27, 'New York', NULL, NULL, 'male', 'Vancouver', '2016-11-01', 'Party, Surfing, Nature', 'Meet Up, TravelMate', 'I''ve travelled around the States for a few months and studied in BC for a year. Now I''m reading to explore more of the planet and volunteer in various countries! ', );
INSERT INTO `profils` (`id`, `user_id`, `mobilenumber`, `age`, `location`, `created_at`, `updated_at`, `sex`, `destination`, `startdate`, `interests`, `looking_for`, `about`, `image`) VALUES
(5, 5, '025166738388', 25, 'London', NULL, NULL, 'female', 'Hawaii', '2016-11-02', 'surfing, spending time at the beach, cocktails, meeting new people', 'meet-up, fun people, surfers and surf locations', 'Hey, my name is Annika, but everyone calls me Nici. I love to surf and I would love to meet other TravelMates, who do so. My next trip will take me to Hawaii, maybe there is someone out there who wanna join me?', );
INSERT INTO `profils` (`id`, `user_id`, `mobilenumber`, `age`, `location`, `created_at`, `updated_at`, `sex`, `destination`, `startdate`, `interests`, `looking_for`, `about`, `image`) VALUES
(6, 6, '0446738992', 25, 'Paris', NULL, NULL, 'male', 'Amsterdam', '2016-09-01', 'Culture, Nature, New People', 'Meet Up', 'I''m going to Amsterdam in the beginning of Semptember, if somebody wants to meet up feel free to contact me!', ),
(7, 7, '01784937495', 22, 'Melbourne', NULL, NULL, 'female', 'Sydney', '2016-09-15', 'Surfing, Nature, Trekking, Party', 'Car Sharing, TravelMate', 'I''m easygoing and want to see as much of the world as possible!  I''m planning two weeks for this trip and i already got a car, so we can just share the fuel costs :)', );
INSERT INTO `profils` (`id`, `user_id`, `mobilenumber`, `age`, `location`, `created_at`, `updated_at`, `sex`, `destination`, `startdate`, `interests`, `looking_for`, `about`, `image`) VALUES
(8, 8, '017837278299', 21, 'Singapore', NULL, NULL, 'female', 'New York', '2016-08-31', 'chatting, taking lang walks in the countryside', 'fun persons to talk to and hang out with', 'Hey there, I am Anouk, you can just call me AnLi. I love the nature and taking lang walks to discover everything around. Maybe you want to take a walk with me to the Central Park at the end of the month?', );
INSERT INTO `profils` (`id`, `user_id`, `mobilenumber`, `age`, `location`, `created_at`, `updated_at`, `sex`, `destination`, `startdate`, `interests`, `looking_for`, `about`, `image`) VALUES
(9, 9, '01535738473', 36, 'New York', NULL, NULL, 'male', 'Vancouver', '2016-10-20', 'Nature, Food, Being around good people', 'Meet Up', 'If it involves nature, fun people and great food then i''m in! I''m going to be in Vancouver around the 20th of September, contact me for a meet up :)', );
INSERT INTO `profils` (`id`, `user_id`, `mobilenumber`, `age`, `location`, `created_at`, `updated_at`, `sex`, `destination`, `startdate`, `interests`, `looking_for`, `about`, `image`) VALUES
(10, 10, '03738992999', 28, 'Berlin', NULL, NULL, 'male', 'New York', '2016-08-24', 'street art, skateboarding', 'some nice guys and their boards to rock the streets', 'Hi there, my name is Dan. I wanna visit New York this month and would like to meet some people there and rock the streets on the skateboard. Text me, if you will be there, too.', );
INSERT INTO `profils` (`id`, `user_id`, `mobilenumber`, `age`, `location`, `created_at`, `updated_at`, `sex`, `destination`, `startdate`, `interests`, `looking_for`, `about`, `image`) VALUES
(11, 11, '016583749502', 26, 'Berlin', NULL, NULL, 'male', 'Amsterdam', '2016-11-20', 'Culture, Music', 'Car Sharing, Meet Up, Roatrip', 'I''m planning to travel to Amsterdam in the end of November, i''m not in a rush, i want to explore as much as possible on the way. If someone want''s to join me just leave me a message!', );
INSERT INTO `profils` (`id`, `user_id`, `mobilenumber`, `age`, `location`, `created_at`, `updated_at`, `sex`, `destination`, `startdate`, `interests`, `looking_for`, `about`, `image`) VALUES
(12, 12, '0037378939', 30, 'Dublin', NULL, NULL, 'male', 'Toronto', '2016-12-15', 'my guitar, singing, relaxing and enjoy the nature', 'some chillin TravelMates for spontaneous jam sessions', 'I love my guitar and singing out loud what goes on in my mind. If you have no fear of getting involved in my world of crazy thoughts and visions, then join me during my jam sessions ;D ', );
INSERT INTO `profils` (`id`, `user_id`, `mobilenumber`, `age`, `location`, `created_at`, `updated_at`, `sex`, `destination`, `startdate`, `interests`, `looking_for`, `about`, `image`) VALUES
(13, 13, '01758759573', 21, 'Byron Bay', NULL, NULL, 'female', 'Sydney', '2016-10-15', 'Surfing, Nature, Food', 'TravelMate, Roadtrip, Meet Up', 'Hey :) I''m in Byron at the moment, working as a nanny. But i''d love to continue my travels in October! I want to drive down the east coast and i got my own car, so if someone needs a ride or wants to travel down with me, contact me :)', );
INSERT INTO `profils` (`id`, `user_id`, `mobilenumber`, `age`, `location`, `created_at`, `updated_at`, `sex`, `destination`, `startdate`, `interests`, `looking_for`, `about`, `image`) VALUES
(14, 14, '0139983789', 32, 'New York', NULL, NULL, 'male', 'Sydney', '2016-08-22', 'nature, back-packing, long walks', 'nice people, who wanna chat about their trips and hang out for some time', 'My name is Enrico and I am from Spain. I love the nature and travel all way walking. I never will travel around by car, cause there is so much I would miss by doing so. Every landscape on my way is a special adventure for me.', );
INSERT INTO `profils` (`id`, `user_id`, `mobilenumber`, `age`, `location`, `created_at`, `updated_at`, `sex`, `destination`, `startdate`, `interests`, `looking_for`, `about`, `image`) VALUES
(15, 16, '04468238947', 23, 'Perth', NULL, NULL, 'male', 'Darwin', '2016-10-01', 'Nature, Surfing, Meeting new people', 'TravelMate, Roadtrip', 'Hey guys, I want to start my westcoast trip beginning of Ocotber in Perth and travel up the coast till Darwin (probably Uluru afterwards). I''m planning to rent a car for the whole time, cause I think it''s a lot easier to see places and stop wherever we want. Anyone who has similar plans and wants to join?', );
INSERT INTO `profils` (`id`, `user_id`, `mobilenumber`, `age`, `location`, `created_at`, `updated_at`, `sex`, `destination`, `startdate`, `interests`, `looking_for`, `about`, `image`) VALUES
(16, 18, '0236382845', 24, 'Perth', NULL, NULL, 'male', 'Darwin', '2016-10-01', 'Nature, Culture, Trekking', 'Roadtrip, TravelMate', 'Hey everyone :) I am looking for a lift to Darwin, and I would also like to do the Gibb River road. I am happy to share the costs of fuel and food. I would like to leave Perth around the 1st Ocotober or earlier. It''s up to u. I just need to be in Darwin on the 20th of October. So if you have a spare Seat please let me know!', ),
(17, 17, '0353536777778', 33, 'Singapore', NULL, NULL, 'male', 'Hong Kong', '2017-03-15', 'culture, sight-seeing, outdoor activities', 'meet-up, nice place to stay for some nights -> can´t pay, but cook ;)', 'Hey, I am a nice dude who loves to travel for little money. Maybe there is someone who could lend me a bed for some nights during my stay in Hong Kong. I cannot pay much, but I would cook some meals in return :)', );
INSERT INTO `profils` (`id`, `user_id`, `mobilenumber`, `age`, `location`, `created_at`, `updated_at`, `sex`, `destination`, `startdate`, `interests`, `looking_for`, `about`, `image`) VALUES
(18, 19, '01748463', 28, 'Berlin', NULL, NULL, 'male', 'Neu-Delhi', '2016-10-01', 'Culture, People, Nature', 'TravelMate', 'Hey there, i''m planning to travel to India. I have been to India plenty of times but it''s time now to travel from Germany to India overland (bus, train, car, hitchhiking etc.). Timeframe is flexible. I''d be happy about travel companion, let me know if you have any similar plans.', ),
(19, 20, '0123783990', 24, 'Amsterdam', NULL, NULL, 'female', 'Dublin', '2016-09-09', 'travelling around, enjoying the landscape, meet new people, taking photos', 'share a car, meet-up, cool spots and photo locations', 'Hi there, I am Hannah and my passion is taking pictures of beautiful landscapes. I travel all around to find new places and meet other photographers to talk about our profession.', );

